import pic2 from '../../123/2.JPG';
import pic3 from '../../123/3.JPG';
import pic4 from '../../123/4.JPG';




class Header extends Component {
    render() { 
        return(
            <>
            <Carousel autoplay className="zone">
                <div>
                <h3 className="contentStyle pic1"></h3>
                </div>
                <div>
                <h3 className="contentStyle pic2"></h3>
                </div>
                <div>
                <h3 className="contentStyle pic3"></h3>
                </div>
                <div>
                <h3 className="contentStyle pic4"></h3>
                </div>
            </Carousel>
            </>
        );
    }
}

export default Header;
